(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[41079],{41079:t=>{t.exports='<div [style.margin-bottom.rem]="2">\n    <tui-radio-list\n        [itemContent]="content"\n        [items]="sizes"\n        [style.flex-direction]="\'row\'"\n        [style.width]="\'max-content\'"\n        [(ngModel)]="size"\n    />\n    <ng-template\n        #content\n        let-value\n    >\n        {{ value === \'s\' ? \'Small\' : value === \'m\' ? \'Medium\' : \'Large\' }}\n    </ng-template>\n</div>\n\n<table\n    tuiTable\n    [size]="size"\n    [style.width.rem]="58"\n    [(ngModel)]="selected"\n>\n    <thead>\n        <tr>\n            <th tuiTh>\n                <div [tuiCell]="size">\n                    <input\n                        tuiCheckbox\n                        tuiCheckboxTable\n                        type="checkbox"\n                        [size]="size === \'l\' ? \'m\' : \'s\'"\n                    />\n                    <span tuiTitle>Checkbox</span>\n                </div>\n            </th>\n            <th tuiTh>Title</th>\n            <th tuiTh>Cell</th>\n            <th tuiTh>Status</th>\n            <th\n                tuiTh\n                [style.width.rem]="10"\n            >\n                Items\n            </th>\n            <th tuiTh>Progress</th>\n            <th tuiTh>Actions</th>\n        </tr>\n    </thead>\n    <tbody tuiTbody>\n        @for (item of data; track item) {\n            <tr>\n                <td tuiTd>\n                    <div [tuiCell]="size">\n                        <input\n                            tuiCheckbox\n                            type="checkbox"\n                            [size]="size === \'l\' ? \'m\' : \'s\'"\n                            [tuiCheckboxRow]="item"\n                        />\n                        <span tuiTitle>\n                            {{ item.checkbox.title }}\n                            <span tuiSubtitle>{{ item.checkbox.subtitle }}</span>\n                        </span>\n                    </div>\n                </td>\n                <td tuiTd>\n                    <div [tuiCell]="size">\n                        <span tuiTitle>\n                            <span tuiStatus>\n                                <tui-icon [icon]="item.title.icon" />\n                                {{ item.title.title }}\n                                @if (item.title.chip && item.title.subtitle) {\n                                    <tui-chip>{{ item.title.chip }}</tui-chip>\n                                }\n                            </span>\n                            @if (!item.title.subtitle && item.title.chip) {\n                                <tui-chip>\n                                    {{ item.title.chip }}\n                                </tui-chip>\n                            } @else {\n                                <span tuiSubtitle>\n                                    {{ item.title.subtitle }}\n                                </span>\n                            }\n                        </span>\n                    </div>\n                </td>\n                <td tuiTd>\n                    <div [tuiCell]="size">\n                        <tui-avatar\n                            [src]="item.cell.name | tuiInitials"\n                            [style.background]="item.cell.name | tuiAutoColor"\n                        />\n                        <span tuiTitle>\n                            {{ item.cell.name }}\n                            <span tuiSubtitle>{{ item.cell.email }}</span>\n                        </span>\n                    </div>\n                </td>\n                <td tuiTd>\n                    <span [tuiStatus]="item.status.color">{{ item.status.value }}</span>\n                </td>\n                <td tuiTd>\n                    <tui-items-with-more [style.gap.rem]="0.25">\n                        @for (chip of item.items; track chip) {\n                            <tui-badge *tuiItem>{{ chip }}</tui-badge>\n                        }\n                        <ng-template\n                            let-number\n                            tuiMore\n                        >\n                            <button\n                                appearance="action-grayscale"\n                                tuiDropdownAlign="right"\n                                tuiDropdownOpen\n                                tuiLink\n                                type="button"\n                                [pseudo]="true"\n                                [tuiDropdown]="dropdown"\n                            >\n                                + {{ item.items.length - number - 1 }}\n                            </button>\n                            <ng-template #dropdown>\n                                <div\n                                    tuiStatus\n                                    [style.padding.rem]="1"\n                                >\n                                    @for (chip of item.items; track chip; let index = $index) {\n                                        @if (index > number) {\n                                            <tui-badge>{{ chip }}</tui-badge>\n                                        }\n                                    }\n                                </div>\n                            </ng-template>\n                        </ng-template>\n                    </tui-items-with-more>\n                </td>\n                <td tuiTd>\n                    <span tuiStatus>\n                        <progress\n                            tuiProgressBar\n                            [style.width.rem]="6"\n                            [value]="item.progress / 100"\n                        ></progress>\n                        {{ item.progress }}ms\n                    </span>\n                </td>\n                <td tuiTd>\n                    <span tuiStatus>\n                        <button\n                            appearance="action"\n                            iconStart="@tui.pencil"\n                            size="xs"\n                            tuiIconButton\n                            type="button"\n                        >\n                            Edit\n                        </button>\n                        <button\n                            appearance="action"\n                            iconStart="@tui.ellipsis"\n                            size="xs"\n                            tuiIconButton\n                            type="button"\n                        >\n                            More\n                        </button>\n                    </span>\n                </td>\n            </tr>\n        }\n    </tbody>\n</table>\n'}}]);